async function ({url}, {h1}, {externalContext}) {
  const browser = await puppeteer.launch();
  const page = await browser.newPage();
  await page.goto(url);
  const pageTitle = await page.title();
  const pageH1 = await page.$eval('h1', el => el.textContent);
  if (pageH1) {
    h1.next(pageH1);
  } else {
    throw new Error(`No h1 tag found on ${pageTitle}`);
  }
  await browser.close();
}
